INSERT INTO `spots` (`spot_id`, `spot`, `lat`, `lng`, `location`, `des`, `image`, `type_id`, `view`, `rate`) VALUES
(1, 'Callao Cave', 17.735484, 121.805012, 'Quibal, Cagayan, Philippines', 'Callao Cave is only one of the 300 caves in the area, it is part of the PeÃ±ablanca Protected Landscape and Seascape; one of the earliest National Parks in the country and considered as the Cave Capital of the Philippines. It has a total of nine chambers, seven of which can be explored by visitors. Its remaining two chambers were closed off by an earthquake during the 80â€™s. It is so massive, it covers two barangay in town. Located at the foothills of western Sierra Madre, Callao Caveâ€™s seven chambers are gynormous; its largest one, soaring to a great height of 118 feet. Of its seven open chambers, five of them have natural roof crevices which let in sunlight all the way to the cave floor. Itâ€™s actually not uncommon to see vegetation growing on some parts of the cave due to these natural skylights.', , 1, 46, 0);
INSERT INTO `spots` (`spot_id`, `spot`, `lat`, `lng`, `location`, `des`, `image`, `type_id`, `view`, `rate`) VALUES
(2, 'Matara Beach', 18.358998, 122.105260, 'Dugo - San Vicente Rd, Gonzaga, Cagayan, Philippines', 'Matara Beach is located along the seashore of Barangay San Jose, Gonzaga, Cagayan, more or less three kilometers from Port Irene, Casambalangan, Sta. Ana, Cagayan.  Matara Beach offers its white sand and shady trees, cool and refreshing sea breeze. It is favorable to boat riding and swimming on its shallow waters over the coral reefs. There are kubos constructed by the Barangay Council of San Jose to be used by visitors at minimal rental cost.  Algae, corals and shells abundantly cover the coral reef. Walking barefooted is extremely exciting. You feel the fineness of the sand and proximity to natureâ€™s reality.', , 6, 90, 0),
(3, 'Calvary Hills', 17.751241, 121.734685, 'Cagayan Valley Rd, Iguig, Cagayan, Philippines', 'Calvary Hills takes pride in its 11 hectares of rolling terrain upon which lies the life-size images of six-meter high statues depicting the 14 Station of the Cross. This site was created in 1982 and conceived by parish priest Rogelio Cortez. It is a good destination for many devotees because it provides a memorable pilgrimage during the Holy Week. ', , 8, 66, 0);
INSERT INTO `spots` (`spot_id`, `spot`, `lat`, `lng`, `location`, `des`, `image`, `type_id`, `view`, `rate`) VALUES
(4, 'Nangaramoan Beach', 18.520576, 122.217946, 'Santa Ana, Cagayan, Philippines', 'Presently, almost all resort in the Nangaramoan Beach is beeping up their construction but hereâ€™s a look of what to expect. Accommodations are simple but comfortable; the sleeping cabins are just the right size for a one bed to fit, spacy floor area for extra mattress, air-conditioned and a private toilet and bathroom. Thereâ€™s no television, internet and cellular networks. Sleeping quarters vary from other resorts in the area.\r\n', , 6, 38, 0),
(5, 'Blue Waterfalls', 18.020742, 121.997820, 'Bolos Point Rd, Baggao, Cagayan, Philippines', 'Blessed and gifted with pristine and stunning views, the town of Baggao in Cagayan Province is thriving with natural wonders where horizons of water, rocks, flora, and fauna can be found. Rolling hills and mountains covered with verdant forest are definitely awe-inspiring creations from a perfect Creator.\r\n\r\nOne of the most-visited attractions in Cagayan is the Bluewater Falls located in Sta. Margarita/Pallagao in Baggao. The blue water cascades through the boulders towards the lagoon. It surely gives a lot of excitement and admiration to anyone who witnesses it.', , 9, 12, 0);
INSERT INTO `spots` (`spot_id`, `spot`, `lat`, `lng`, `location`, `des`, `image`, `type_id`, `view`, `rate`) VALUES
(6, 'Palaui Island', 18.560426, 122.140541, 'Palaui Island, Santa Ana, Philippines', 'Palaui Island lies off the northwestern part of a large promontory in San Vicente, in the municipality of Santa Ana, Cagayan province. It is 10 kilometres (6.2 mi) at its longest and about 5 kilometres (3.1 mi) at its widest and moderately high. The western shore of the island appears bold, but on the eastern side, a reef projects from its side for 2.4 kilometres (1.5 mi), the edge of it being 0.8 kilometres (0.50 mi) from and extending around the small islet of Escucha, east of Palaui. The Dos Hermanos rocky islets lie off Cape EngaÃ±o, in the northern point of Palaui, and there are some rocks off the northeast point of the island, about 1.6 kilometres (0.99 mi) eastward of the cape. Gran Laja island, a low rock islet surrounded by breakers, is one of the rocks located northeast off Palaui.[1][2]\r\n\r\nAt the southwest end of Palaui Island is Puerto Point, a high, wooded bluff. East of the point and south of Palaui is Rona Island, a low, wooded island with a white base of sand and rocks. Escucha Island is a high and wooded islet east of Palaui, and beyond Rona Island when seen from southwestward through the channel between Palaui Island and the mainland, where a few more islets are located', , 3, 6, 0),
(7, 'blue water', 17.914235, 121.947311, 'Baggao, Cagayan, Philippines', 'blue water', , 3, 13, 0),
(8, 'tuguefa', 17.613181, 121.727021, 'Tuguegarao, Cagayan, Philippines', 'neraby hotel', '', 0, 0, 0),
(9, 'beach', 17.613618, 121.730565, '40 Gomez St, Tuguegarao, 3500 Cagayan, Philippines', 'beach', '', 3, 1, 0);

